import React, { useState, useEffect } from 'react';
import { GoogleMap, Marker, InfoWindow, DirectionsRenderer, useJsApiLoader } from '@react-google-maps/api';

const Vehiculos = () => {
  const [vehiculos, setVehiculos] = useState([]);
  const [vehiculoActivo, setVehiculoActivo] = useState(null);
  const [timeoutId, setTimeoutId] = useState(null);
  const [directionsResponse, setDirectionsResponse] = useState(null);
  const [destination, setDestination] = useState(null); // Para almacenar el destino seleccionado

  const { isLoaded } = useJsApiLoader({
    googleMapsApiKey: 'AIzaSyCcF0vvhLLmuLAJcnh2ElM9aLcIwtiiwMo',
  });

  useEffect(() => {
    const vehiculosEnTiempoReal = [
      { id: 1, lat: -38.73965, lng: -72.58948, nombre: 'Patente 1', conductor:'Alfonso Martinez', estado: 'En ruta'},
      { id: 2, lat: -38.73559, lng: -72.59386, nombre: 'Patente 2' , conductor:'Josefa Alvarez', estado:'En mantención'},
      { id: 3, lat: -38.7388, lng: -72.5995, nombre: 'Patente 3', conductor:'Emilio Aravena' , estado:'Disponible'},
      { id: 4, lat: -38.73285, lng: -72.61691, nombre: 'Patente 4', conductor:'Jose Soto' , estado:'Disponible'},
    ];
    setVehiculos(vehiculosEnTiempoReal);
  }, []);

  const handleMouseOver = (vehiculo) => {
    if (timeoutId) {
      clearTimeout(timeoutId); // Cancela el cierre si el mouse vuelve rápidamente
      setTimeoutId(null);
    }
    setVehiculoActivo(vehiculo);
  };

  const handleMouseOut = () => {
    const id = setTimeout(() => {
      setVehiculoActivo(null);
    }, 1000); // Mostrar 1 segundo extra
    setTimeoutId(id);
  };

  // Función para manejar el clic en el mapa
  const handleMapClick = (event) => {
    setDestination({
      lat: event.latLng.lat(),
      lng: event.latLng.lng(),
    });
  };

  // Función para calcular la ruta
  const calculateRoute = () => {
    if (vehiculoActivo && destination) {
      const directionsService = new window.google.maps.DirectionsService();
      directionsService.route(
        {
          origin: { lat: vehiculoActivo.lat, lng: vehiculoActivo.lng },
          destination: destination,
          travelMode: window.google.maps.TravelMode.DRIVING,
        },
        (result, status) => {
          if (status === window.google.maps.DirectionsStatus.OK) {
            setDirectionsResponse(result);
          } else {
            console.error('Error al obtener las direcciones:', result);
          }
        }
      );
    }
  };

  // css container Maps
  const containerStyle = {
    width: '100%',
    height: '900px',
  };

  const center = {
    lat: -38.73965, // Centrado en Temuco (puedes modificar esto)
    lng: -72.59842,
  };

  if (!isLoaded) return <div>Cargando mapa...</div>;

  return (
    <div className='vehiculo'>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={14}
        onClick={handleMapClick}  // Agregar el clic en el mapa
      >
        {vehiculos.map((vehiculo) => (
          <Marker
            key={vehiculo.id}
            position={{ lat: vehiculo.lat, lng: vehiculo.lng }}
            label={{text: vehiculo.nombre, fontWeight: 'bold'}}
            icon={{
              url: '/icons/vehiculo1.png',
              scaledSize: new window.google.maps.Size(40, 40),
              labelOrigin: new window.google.maps.Point(20, -10),
            }}
            onMouseOver={() => handleMouseOver(vehiculo)}
            onMouseOut={handleMouseOut}
          />
        ))}

        {vehiculoActivo && (
          <InfoWindow
            position={{ lat: vehiculoActivo.lat, lng: vehiculoActivo.lng }}
            onCloseClick={() => setVehiculoActivo(null)}
            options={{ disableAutoPan: true }}
          >
            <div className='info-window'>
              <h4 className='info-title'>{vehiculoActivo.nombre}</h4>
              <p className='info-estado'>Conductor: {vehiculoActivo.conductor}</p>
              <p className='info-estado'>Estado: {vehiculoActivo.estado}</p>
            </div>
          </InfoWindow>
        )}

        {/* Mostrar la ruta calculada */}
        {directionsResponse && (
          <DirectionsRenderer directions={directionsResponse} />
        )}
      </GoogleMap>
      {/* Botón para calcular la ruta */}
      <button onClick={calculateRoute}>Calcular Ruta</button>
    </div>
  );
};

export default Vehiculos;
